import React from "react";
import { Link } from "react-router-dom";
import './card.css'

export default function Card(props){
    const cardList = fetch('../../json/housing.json').then(response => {
        response.json().then(cards => {
            cards.forEach(card =>
                <Link {...to='/housing.id=}' + card.id }className="card">
                    <h2>${props.title}</h2>
                </Link>
            )
        })
    })
    return (
        <div className="card">
            <p>{props.data.someProperty}</p>
        </div>
    )
}
